import React, { Component } from 'react';
class ControlPanel extends Component {
    state = {}
    render() {
        return (<div style={this.props.style}>
            <iframe width="425" height="350" frameborder="0" scrolling="no" marginheight="0" marginwidth="0" src="https://www.openstreetmap.org/export/embed.html?bbox=-87.40042179822923%2C46.538910411903124%2C-87.39826798439027%2C46.53996942533793&amp;layer=mapnik" style={{}}>
            </iframe>
        </div>);
    }
}

export default ControlPanel;
